import React from 'react';
import Header from '../header/Header';
import Footer from '../footer/Footer';

export default class Body extends React.Component {

    render() {
        return(
            <div className='app-body'>
                <Header />
                <div className='content'>
                    <h2> Content </h2>
                </div>
                <Footer />
            </div>
        )
    }
}
